import React, { useState } from "react";
import { Button } from "@mui/material";
// import styles from "./SelectPerimeter.module.scss";
// import Tooltip from "@mui/material/Tooltip";
// import IconButton from "@mui/material/IconButton";
// import WMSMap from "../../../map/WMSMap";
// Importă orice alte componente și stiluri necesare

function SelectPerimeter() {
  // Component logic and JSX here
  return (
    <div>
      <h1>Select Perimeter</h1>
      <p>Choose the perimeter you wish to continue with</p>
      <Button variant="contained" color="primary">
        Gothenburg
      </Button>
      <Button variant="contained" color="primary">
        Vienna
      </Button>
      <Button variant="contained" color="primary">
        Rennes
      </Button>
    </div>
  );
}

export default SelectPerimeter; // Exportă componenta implicit
